import './App.css';
import $ from 'jquery'
import {Route, Switch} from "react-router-dom"
import {Car} from "./Structures/Car.js";
import {TechnicalCharacteristics} from "./Structures/TechnicalCharacteristics";
import Navigation from "./components/Navbar/Navigation.jsx";
import LoginPage from "./components/LoginPage/LoginPage";
import HomePage from "./components/HomePage/HomePage";
import CarsPage from "./components/CarsPage/CarsPage";
import Form from "./components/CreateAdForm/AdForm";


function App() {
  let car = new Car("Машина", "нормальное авто", ["1.jpg", "2.jpg"], 10 , "+79323221649",
      new TechnicalCharacteristics("Камаз", "А-10",1920, "DFFD", -1));
  return (
    <>
    <button onClick={() => {
      $.ajax({
        type: "POST",
        url: "http://38eee3a1c015.ngrok.io/cars/add-car",
        data: {car: car}
      }).then(it =>
      {
        $.get("http://38eee3a1c015.ngrok.io/cars").then(it => {console.log(it)})
        console.log(it)
      })
    }}>AddCar</button>
    <div>
      <input id={"car-input"} placeholder={"CarId"}/>
      <button onClick={() => {
        console.log($("#car-input").val())
        $.get(`http://38eee3a1c015.ngrok.io/cars/delete-car?id=${$("#car-input").val()}`).then(it => {
          $.get("http://38eee3a1c015.ngrok.io/cars").then(it => {console.log(it)})
          console.log(it)
        })
      }}>RemoveCar</button>
    </div>


    <Switch>
        <Route path={"/login"} render={() => <LoginPage/>}/>
        <Route path={"*"} render={()=><Navigation/>}/>
    </Switch>
    <Switch>
        <Route path={"/home"} render={()=><HomePage/>}/>
        <Route path={"/cars"} render={()=><CarsPage/>}/>
        <Route path={"/createAd"} render={() => <Form/>}/>
    </Switch>
    </>
  );
}

export default App;
